import { TokenList } from "../types";
// import schema from "@uniswap/token-lists/src/tokenlist.schema.json";
// import Ajv from "ajv";
import axios from "axios";

const oneInch = "https://api.1inch.exchange/v3.0/56/tokens";

export default async function getTokenList(): Promise<TokenList | undefined> {
  const { data } = await axios.get(oneInch);
  if (data.hasOwnProperty("tokens")) return data.tokens;
  return undefined;
}
